script: |
  super -f tsv -I q5678.sql | sort > q5678.out

vector: true

inputs:
  - name: q5678.sql
    data: |
      SELECT DISTINCT - 23 AS col0, + col1 * + + 7 * CAST ( ( col1 ) AS INTEGER ) * - 30 + - - 39 + - col1 * - - ( - - col1 ) AS col1 FROM tab1 AS cor0;
  - name: tab1

outputs:
  - name: q5678.out
    data: |
      -23	-41317
      -23	-466060
      -23	-5236
